function update( event ) {

	var time = event.time * 0.001;

	this.position.x = Math.sin( time ) * 4;
	this.position.z = Math.cos( time ) * 4;
	this.lookAt( scene.position );

}

AA5824A6-AC9B-4308-8EEB-5F6997F5B2AA.source:
var state = 0; // 0 for going left, 1 for going right
var initialX = this.position.x;

function update( event ) {
	var time = event.time * 0.00001;
	var toAdd = new THREE.Vector3(0,0,0);

	if (this.position.x < initialX - 1) {
		state = 1;
	} else if (this.position.x > initialX + 1) {
		state = 0;
	}

	if (state == 1) {
		toAdd.x = 0.005;
	} else if (state == 0) {
		toAdd.x = -0.005;
	}

	this.position.add(toAdd);
}

